import React, { Component } from 'react';
import PianoComponent from './PianoComponent.js';
import MidiPlayerComponent from './MidiPlayerComponent.js';
import './components/Music.css';
import { Row, Col } from 'react-simple-flex-grid';
import "react-simple-flex-grid/lib/main.css";
import ReactHintFactory from 'react-hint'
import 'react-hint/css/index.css'

const ReactHint = ReactHintFactory(React)
class Music extends Component {
  constructor(props){
    super(props);

    this.state = {
    }
    this.octave = 2;
    this.max_number_of_piano_keys = 80;

    this.resetKeyBoard = this.resetKeyBoard.bind(this);

    this.resetKeyBoard();
  }
  resetKeyBoard(){
    for(var i = 0; i<this.max_number_of_piano_keys; i++){
      this.state["key_"+i] = 0;
    }
    this.setState(this.state);
  }
  OnNoteOn(noteNumber){
    if(noteNumber > this.octave*2 + this.max_number_of_piano_keys){
      return;
    }
    let key = "key_"+ (noteNumber - this.octave*12);
    this.state[key] = 1;
    this.setState(this.state);
  }
  OnNoteOff(noteNumber){
    if(noteNumber > this.octave*2 + this.max_number_of_piano_keys){
      return;
    }
    let key = "key_"+(noteNumber - this.octave*12)
    this.state[key] = 0;
    this.setState(this.state);
  }
  render() {
    return (
      <div>
        <ReactHint events delay={100} />
        <Row gutter={10} align="middle" justify="center">
          <Col xs={11} sm={6} md={6} lg={6} xl={6}>
            <MidiPlayerComponent dataUri={this.props.song1} onNoteOn={this.OnNoteOn.bind(this)} onNoteOff={this.OnNoteOff.bind(this)} resetKeyBoard={this.resetKeyBoard}/>
          </Col>
          <Col xs={11} sm={6} md={6} lg={6} xl={6}>
            <MidiPlayerComponent dataUri={this.props.song2} onNoteOn={this.OnNoteOn.bind(this)} onNoteOff={this.OnNoteOff.bind(this)} resetKeyBoard={this.resetKeyBoard}/>
          </Col>
        </Row>
        <Row align="middle" justify="center">
          <Col span={12}>
            <PianoComponent key_states={this.state} noFloor />
          </Col>
        </Row>
      </div>
    );
  }
}
App.defaultProps = {
  song1: "data:audio/midi;base64,",
  song2: "data:audio/midi;base64,"

}

export default Music;
